column29:
Apăsând pe butonul drept al mouse-ului/șoarecelui de pe suprafața pe care este așezat, click-ul fiind poziționat pe o zonă liberă a videoclipului, apar mai multe opțiuni oferite de către platforma YouTube:

* Account;
* Loop;
* Copy video URL;
* Copy video URL at current time;
* Copy embed code;
* Copy debug info;
* Troubleshoot playback issue;
* Stats for nerds.

Meniul este format din următoarele butoane:

* AM PODCA;
* Președintele României;
* Guvernul României;
* Senatul României;
* Camera Deputaților;
* Uniunea Europeană;
* Infoeuropa;
* Ministerul Dezvoltării Regionale și Turismului.
